import React from 'react';
import "./User.css";

const UserTracks = props => {
    const usersData = props.items;
    let count = 1;
    const tracksData = usersData.map((artist) =>
            <div className="artistDiv">
                <div className="text">
                    <h1 className="count" >#{count++}</h1>
                    <h1 className="artistName">{artist.name}</h1>
                    <h4>{artist.artists[0].name}</h4>
                </div>
                <div className="imageDiv">
                    <a href={artist.external_urls.spotify} target="_blank" rel="noopener noreferrer">
                        <img src={artist.album.images[0].url} alt="artist" className="image"/>
                    </a>
                </div>
            </div>
    ) 
    return (
        <div className="section">
            {tracksData}
        </div>
    )
}
export default UserTracks;
